import React from 'react';
import { ListGroup } from 'react-bootstrap';

const ServiceItem = ({ name }) => {
  return (
    <ListGroup.Item style={styles.item}>
      {name}
    </ListGroup.Item>
  );
};

const styles = {
  item: {
    backgroundColor: '#dddddd',
    color: '#9b9779',
  },
};

export default ServiceItem;
